import React, { useState } from 'react';
import { User, Mail, Phone, Code } from 'lucide-react';

export default function AddStudentForm({ setOpenHandleForm }) {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    phone: '',
    handle: '',
  });

  const handleSubmit = (e) => {
    e.preventDefault();
    // TODO: Add save logic
  };

  const handleCancel = () => setOpenHandleForm(false);

  return (
    <div className="fixed inset-0 z-50 flex items-center justify-center backdrop-blur-sm bg-black/30">
      <form
        onSubmit={handleSubmit}
        className="bg-transparent  text-white w-[95%] sm:w-[400px] p-6 rounded-2xl shadow-xl space-y-5"
      >
        <div className="flex justify-between items-center">
          <h2 className="text-lg font-bold flex items-center gap-2">
            <User className="h-5 w-5 text-blue-400" /> Add New Student
          </h2>
          <button
            type="button"
            onClick={handleCancel}
            className="text-zinc-400 hover:text-white text-xl"
          >
            &times;
          </button>
        </div>

        {/* Full Name */}
        <div className="space-y-1">
          <label className="text-sm font-medium text-zinc-300 flex items-center gap-2">
            <User className="h-4 w-4" /> Full Name
          </label>
          <input
            type="text"
            placeholder="Enter student's full name"
            className="w-full px-4 py-2 bg-zinc-800 border border-zinc-700 rounded-lg text-white placeholder-zinc-400 focus:outline-none focus:ring-2 focus:ring-blue-500"
            value={formData.name}
            onChange={(e) => setFormData({ ...formData, name: e.target.value })}
            required
          />
        </div>

        {/* Email */}
        <div className="space-y-1">
          <label className="text-sm font-medium text-zinc-300 flex items-center gap-2">
            <Mail className="h-4 w-4" /> Email Address
          </label>
          <input
            type="email"
            placeholder="student@example.com"
            className="w-full px-4 py-2 bg-zinc-800 border border-zinc-700 rounded-lg text-white placeholder-zinc-400 focus:outline-none focus:ring-2 focus:ring-blue-500"
            value={formData.email}
            onChange={(e) => setFormData({ ...formData, email: e.target.value })}
            required
          />
        </div>

        {/* Phone */}
        <div className="space-y-1">
          <label className="text-sm font-medium text-zinc-300 flex items-center gap-2">
            <Phone className="h-4 w-4" /> Phone Number
          </label>
          <input
            type="tel"
            placeholder="+1 (555) 123-4567"
            className="w-full px-4 py-2 bg-zinc-800 border border-zinc-700 rounded-lg text-white placeholder-zinc-400 focus:outline-none focus:ring-2 focus:ring-blue-500"
            value={formData.phone}
            onChange={(e) => setFormData({ ...formData, phone: e.target.value })}
            required
          />
        </div>

        {/* Handle */}
        <div className="space-y-1">
          <label className="text-sm font-medium text-zinc-300 flex items-center gap-2">
            <Code className="h-4 w-4" /> Codeforces Handle
          </label>
          <input
            type="text"
            placeholder="username"
            className="w-full px-4 py-2 bg-zinc-800 border border-zinc-700 rounded-lg text-white placeholder-zinc-400 focus:outline-none focus:ring-2 focus:ring-blue-500"
            value={formData.handle}
            onChange={(e) => setFormData({ ...formData, handle: e.target.value })}
            required
          />
        </div>

        {/* Buttons */}
        <div className="flex justify-end gap-3 pt-4">
          <button
            type="button"
            onClick={handleCancel}
            className="px-4 py-2 bg-zinc-700 text-white rounded-lg hover:bg-zinc-600"
          >
            Cancel
          </button>
          <button
            type="submit"
            className="px-4 py-2 bg-blue-600 text-white rounded-lg hover:bg-blue-700"
          >
            Add Student
          </button>
        </div>
      </form>
    </div>
  );
}
